                <h1>Created by Zunirry</h1>
                <p>A course with Next.js</p>
                <style jsx >{`
                    :global(body) {
                    background: #1A2A35;
                    }

                    h1{
                        color: #cccc;
                    }
                    p{
                        color: #cccc;
